import "./style/App.css";
import React from "react";
import "./style/bootstrap.min.css";

function Torneo() {
  return (
    <>
      <div class="col-lg-8 mx-auto p-3 py-md-5">
        <header class="d-flex align-items-center pb-3 mb-5 border-bottom">
          <h1>Torneos</h1>
        </header>
        <main>
          <table>
            <th>
              <h1>Hello</h1>
            </th>
          </table>
        </main>
      </div>
    </>
  );
}

export default Torneo;
